import React from "react";
import { makeStyles, Paper } from "@material-ui/core";


import styles from "../styles/QuestionStyle";
import McQuestion from "./McQuestion";
import CbQuestion from "./CbQuestion";
import TextQuestion from "./TextQuestion";
import NumQuestion from "./NumQuestion";
import ScaleQuestion from "./ScaleQuestion";



const useStyles = makeStyles(styles);


export default function Question(props) {

  const classes = useStyles();
  let question;
  if (props.qInfo==="mc") question = <McQuestion qInfo={props.qInfo} />;
  else if (props.qInfo==="cb")  question = <CbQuestion qInfo={props.qInfo} />;
  else if (props.qInfo==="text")  question = <TextQuestion qInfo={props.qInfo} />;
  else if (props.qInfo==="num")   question = <NumQuestion qInfo={props.qInfo} />;
  else if (props.qInfo==="scale") question = <ScaleQuestion qInfo={props.qInfo} />;

  return (
    <React.Fragment>

      { question }
        
    </React.Fragment>
  )

}
